    }

    .container {
        height: 255px;
        display: inline-block;
        margin-top: 5px;
        width: 100%
    }

        margin-left: 5px;
        margin-top: 50px;
        display: inline-block;

        height: 200px;

        background-color: #980000;
        color: #f6f6f6;
        padding: 7px 90px 5px 90px;
        text-decoration: none;
    }

        .start-button span {
            margin: 5px 0 5px 40px;
        }

        .start-button img {
            position: absolute;
            margin-top: 2px;
        }

    .onetimepwd-link {
        color: brown;
        font-size: 0.8em;
        font-family: serif;
        text-decoration: underline;
    }

    .remember-id {
        font-size: 1em;
        font-family: serif;
    }

    #disclaimer {
        font-size: 0.6em;
        color: #aaa;
        position: absolute;
        bottom: 0;
    }

    input {
        border: 1px solid black;
        margin-top: 5px;
    }

    #onetimepwd {
        background-color: #ddd;
    }

    .center-banner {
        width: 100%;
        height: 100px;
        background-color: #ddd;
        margin: 10px 0 3px 0;
        text-align: center;
        cursor: hand;
    }

    .banner-container {
        width: 100%;
        height: 70px;
    }

    .small-banner {
        width: 260px;
        height: 100%;
        background-color: #ddd;
    }
</style>
